import ast from "./ast.JPG";
import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.css";

class Welcome extends Component {
  render() {
    return (
      <div className="w-full">
        <div className="row">
          <div
            className="col"
            style={{ backgroundImage: "url(" + { ast } + ")" }}
          ></div>
          <div
            className="col"
            style={{ backgroundImage: "url(" + { ast } + ")" }}
          >
            2 of 2
          </div>
        </div>
      </div>
    );
  }
}

export default Welcome;
